import { createBrowserRouter } from "react-router-dom";
import App from "./App";
import {Home, Contact} from "./rotas"

const router = createBrowserRouter([
    {
      path: "/",
      element: <App />,
      children: [
        {
          path: "/",
          element: <Home />
        },
        {
          path: "/contact",
          element: <Contact />
        }
      ]
    }
  ]);

export default router;
